import Navbar from '../Components/Navbar.js';

const ContactUs =()=>{
    return(
<>
<Navbar/>
      <h1 id="SFtitle">Sample Flowers</h1>
      <h1 class ="contacttitle">Contact Us</h1>
        <h2>Address: 1111 Main st. Rosemont,CA 900</h2> 
        <h2> Phone</h2>
        <h2> Email</h2>
      
</>
)};

export default ContactUs;
